const Navbar = () => {

  let navItems1 = [
    { path: '/', 
      name: 'Home' 
    },

    { path: '/about',
     name: 'About' 
    },

    { path: '/secret',
     name: 'Contact'
    }
  ];


  const navItems2 = null;

  return (
    <nav className="navbar">
      <div className="container">
        <Link to="/" className="logo">Fix the Bug Site</Link>
        <ul className="nav-links">
          {/* Check if navItems is null before mapping over it */}
          {navItems1 && navItems1.map((item, index) => (
            <li key={index}>
              <Link to={item.path}>{item.name}</Link>
            </li>
          ))}
        </ul>
      </div>
    </nav>
  );
}

export default Navbar;
